} from "@mui/material";









const Searchbar = () => {
  return (
    <>
       <Box sx={{display: "flex" , backgroundColor:'#fff' ,borderRadius:'100px'}} >
        <Box sx={{flexGrow:0 ,paddingLeft:'20px' , lineHeight:'50px' ,width:'160px'}}>
          <Box > 

       }
         
          </Box>
         
            
        </Box>
        <Divider orientation="vertical" flexItem />
        <Box sx={{flexGrow:2}}>
          Searchbar
        </Box>

       </Box>

     
      
    </>
  )
}

export default Searchbar
